description:
&quot;This dataset displays the lat/lon locations of all Murder crimes that were reported in the Central &amp; Eastern Police Districts of the City of Baltimore from 10.3.2009 to 10.17.2009.

The data comes from the City of Baltimore's Police Department Crime Mapping website that can be found at the citation url provided in the metadata.

The data was gathered by viewing the crime mapper locations and manually obtaining the lat/lon locations of these incidents from Google Earth.&quot;
